<template>
	<view class="content">
		<view class="status_bar"></view>
		<view class="top">
			<view class="top_label">{{ totalMoneyShow }}.00</view>
			<view class="top_vip">
				<image src="../../static/32.png"></image>
				<text>我的会员</text>
			</view>
		</view>
		<view class="bottom">
			<view class="bottom_label">充值方案</view>
			<view class="bottom_list">
				<view class="list_item" v-for="(x, y) in vipTypeArray" :key="y" @click="choose(y)">
					<view class="item_img"><image src="../../static/33.png"></image></view>
					<view class="item_text">
						<view class="text_top">{{ x.newtime }}</view>
						<view class="text_bottom" v-if="x.vip_type != 99">全站{{ x.time }}{{ x.vip_type == '2' ? '天' : '月' }}观看</view>
						<view class="text_bottom" v-if="x.vip_type == 99">永久全站观看</view>
					</view>
					<view :class="{item_btn_active:x.active}" class="item_btn">
						<view class="btn_top">￥{{ x.money }}</view>
						<view class="btn_bottom">立即购买</view>
					</view>
				</view>
			</view>
			<view class="tip">本站所提供的金额交易采用目前最严密标注SSL-128位加密，保证安全隐秘，消费明细不会有任何色情字样，充值完成后系统会自动充值到您的账户</view>
		</view>

		<view class="layer" :hidden="!tipShow">
			<view class="layer_content">
				<view class="layer_label">选择充值通道</view>
				<view class="layer_tos">
					<view class="layer_top">
						<image src="../../static/33.png"></image>
						<view>￥{{ totalMoneyShow }}</view>
					</view>
					<view class="layer_text">系统自动充值到账户</view>
				</view>
				<view class="layer_btn" @click="goPay(2)">
					<!-- <image src="../../static/35.png"></image> -->
					<text>微信支付</text>
				</view>
				<view class="layer_btn" @click="goPay(1)">
					<!-- <image src="../../static/36.png"></image> -->
					<text>支付宝支付</text>
				</view>
			</view>
			<image src="../../static/34.png" class="close" @click="close"></image>
		</view>
	</view>
</template>

<script>
import util from '../../utils/public';
export default {
	name: 'vipCenter',
	data() {
		return {
			userInfoObject: {},
			vipTypeArray: [],
			vipInfoObject: {},
			payType: 2,
			vipType: 1,
			totalMoneyShow: null,
			totalMoneySubmit: null,
			tipShow:false,
		};
	},
	onLoad() {
		this.getVipInfo();
	},
	methods: {
		choose(ys){
			let data = this.vipTypeArray;
			data.map((x,y)=>{
				x.active = false;
			});
			data[ys].active = true;
			this.vipTypeArra = data;
			this.tipShow = true;
			this.totalMoneyShow = data[ys].money;
			this.totalMoneySubmit = data[ys].money;
		},
		close(){
			this.tipShow = false;
		},
		async getVipInfo() {
			let data = await util.getInfoByAxios(
				'post',
				`${util.config.host}/api/Pay/payConf`,
				{},
				true
			);
			console.log(data);
			this.vipInfoObject = data.data.data;
			data.data.data.option.map((x, y) => {
				if (y == 2) {
					x.active = true;
				} else {
					x.active = false;
				}
			});
			this.vipTypeArray = data.data.data.option;
			if (this.vipTypeArray.length > 2) {
				if (this.vipTypeArray[2].rebate == '0') {
					this.totalMoneyShow = this.vipTypeArray[2].money;
					// this.totalMoneySubmit = this.vipTypeArray[0].money;
				} else {
					this.totalMoneyShow = parseInt(this.vipTypeArray[2].money) * parseFloat('0.' + this.vipTypeArray[2].rebate);
					// this.totalMoneySubmit = parseInt(this.vipTypeArray[0].money)*(parseFloat("0."+this.vipTypeArray[0].rebate));
				}
				this.totalMoneySubmit = this.vipTypeArray[2].money;
			} else {
				this.totalMoneyShow = null;
				this.totalMoneySubmit = null;
			}
		},
		async goPay(type) {
			console.log(util.config.channel,type,util.judgeParams().uid, parseInt(this.totalMoneySubmit));
			const data = await util.getInfoByAxios(
				'post',
				`${util.config.host}/api/Pay/payStart`,
				{
					pay_type: type,
					money: parseInt(this.totalMoneySubmit)
				},
				true
			);
			console.log(data);
			if (data.data.data.token) {
				plus.runtime.openURL(data.data.data.token, function(res) {
					console.log(res);
				});
			} else {
				uni.showToast({
					title: data.data.msg,
					icon: 'none'
				});
			}
		},
	},
	filters: {
		/*修改时间戳*/
		dealTime(obj) {
			if (obj == 2208960000) {
				return '无限制';
			} else {
				let unixTimestamp = new Date(obj * 1000);
				let years = unixTimestamp.getFullYear();
				let months = String(unixTimestamp.getMonth() + 1).length > 1 ? unixTimestamp.getMonth() + 1 : '0' + (unixTimestamp.getMonth() + 1);
				let days = String(unixTimestamp.getDate()).length > 1 ? unixTimestamp.getDate() : '0' + unixTimestamp.getDate();
				let hours = String(unixTimestamp.getHours()).length > 1 ? unixTimestamp.getHours() : '0' + unixTimestamp.getHours();
				let minutes = String(unixTimestamp.getMinutes()).length > 1 ? unixTimestamp.getMinutes() : '0' + unixTimestamp.getMinutes();
				let seconds = String(unixTimestamp.getSeconds()).length > 1 ? unixTimestamp.getSeconds() : '0' + unixTimestamp.getSeconds();
				let commonTime = years + '-' + months + '-' + days + ' ' + hours + ':' + minutes + ':' + seconds;
				return commonTime;
			}
		}
	}
};
</script>

